import React from "react";
import "../assets/styles/components/workSamples.css";

const WorkSamples = props => {
  return (
    <section className="workSamples">
      <img
        src={require("../assets/images/work-samples.png")}
        alt="work samples"
      />
    </section>
  );
};

export default WorkSamples;
